import React, { useState, useEffect } from "react"
import sanityCient from "../client"

const Post = () => {
  const [postData, setPostData] = useState(null)

  useEffect(() => {
    sanityCient
      .fetch(
        `*[_type == 'post']{
        title,
        slug,
        mainImage{
          asset->{
            _id,
            url
          },
          alt
        }
      }`
      )
      .then((data) => setPostData(data))
      .catch(console.error)
  }, [])
  return (
    <main>
      <section>
        <h1></h1>
        <h2></h2>
        <div>
          <article>
            <span>
              <img />
              <span>
                <h3></h3>
              </span>
            </span>
          </article>
        </div>
      </section>
    </main>
  )
}

export default Post
